import React from 'react';
import {
  createBrowserRouter,
  RouterProvider,
  Routes,
  Route,
  Link,
  BrowserRouter,
} from 'react-router-dom';
import Records from './pages/Records/Records';
import SearchBar from './pages/SearchBar/SearchBar'
import './style.css';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>

          <Route path="/" element={<Records/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
